    return (
        <Paper sx={{
            position: 'relative',
            display: 'flex',
            justifyContent:'end',
            gap:2

        }}>
            <Button variant="contained" sx={{ 
                bgcolor: '#ef6c00', 
                "&:hover": { backgroundColor: "#ef6c00"},
                m:'1.5rem'
                 }} >Place Order</Button>
        </Paper>
    )
}

export default PlaceOrder
